import React from "react";

const SearchBar = ({ value, onChange }) => {
  return (
    <form
      style={{
        border: "1px solid darkkhaki",
        color: "darkkhaki",
        margin: "20px",
      }}
    >
      <h1>Search component</h1>
      <input
        type="search"
        name="query"
        placeholder="Search"
        value={value}
        onChange={(e) => onChange(e.currentTarget.value)}
      />
    </form>
  );
};

export default SearchBar;
